import React, { Component } from 'react'

class Footer extends Component {
    render() {
        return (
            <footer className="footer">
                <span className="text-muted bottom footer-txt">כל הזכויות שמורות 2021 יונתן לוי</span>
            </footer>
        )
    }
}

export default Footer
